function addNewRow(n,m){var h=document.getElementById(n);var d=h.rows.length;var b=h.insertRow(d-1);var j=b.insertCell(0);var i=h.rows[d-2].cells[0].innerHTML;var k=/\[(\d+)\]/gi;var g=i.match(k);var f=g[g.length-1].replace(/\[|\]/g,"");var a=new RegExp("("+m+")\\[(\\d*)\\]","gi");var c=new RegExp("("+m+")_(\\d*)_","gi");j.innerHTML=i.replace(a,"$1["+(parseInt(f)+1)+"]");j.innerHTML=j.innerHTML.replace(c,"$1_"+(parseInt(f)+1)+"_");var e=BX.findChild(j,{tag:"span","class":"adm-input-file"},true);if(e){e.firstChild.innerHTML=BX.message("JSADM_FILE")}if(BX.adminFormTools){BX.bind(BX.findChild(j,{tag:"input","class":"adm-designed-file"},true),"change",BX.adminFormTools._modified_file_onchange)}setTimeout(function(){var s=BX.findChildren(j,{tag:/^(input|select|textarea)$/i});if(s&&s.length>0){for(var q=0,p=s.length;q<p;q++){if(s[q].form&&s[q].form.BXAUTOSAVE){s[q].form.BXAUTOSAVE.RegisterInput(s[q])}else{break}}}},10);var o=new RegExp("<script[^>]*?>([\\w\\s\\S]*?)<\/script>","gmi");var l;while(l=o.exec(j.innerHTML)){if(l[1]){BX.evalGlobal(l[1])}}};